import React from 'react'
import { useState } from 'react'
import '../App.css'

const Header = () => {
    const [word,setWord] = useState("")

    let changeHandler = (event) =>{
        setWord(event.target.value)

    }

  return (
    <div className='Header'>
        <div className='title'>
            Word Hunting 
        </div>

        <div className='word'>
            <h1>{word}</h1>
        </div>
        <div className='input'>
        <input className='inp-field' type="text" onChange={changeHandler}value={word} placeholder='Enter Here!'/>

        </div>
    </div>
  )
}

export default Header
